import React, { Component } from 'react'
import stars from '../media/5_stars_logo.png'
export default class MainInfo extends Component {
    getArrPrices = () => {
        let prices = this.props.dataResponse.prices.offerPrice
        return prices
    }
    render() {
        return (
            <div>
                <h1>{this.props.dataResponse.name}</h1>
                <small>
                    <span className = 'sku'>
                        SKU:
                        {this.props.dataResponse.partNumber}
                    </span>
                </small>
                <img src={stars}/>
                <span>(1 compActualizar)</span>
                <div>
                    { this.getArrPrices()}
                </div>
            </div>
        )
    }
}
